CREATE TABLE ONLINE_SHENGPAY_MGR.HIT_STRATEGY_STATISTICS_REPORT
(
    ID NUMBER(16) PRIMARY KEY NOT NULL ,
    RULE_CODE VARCHAR2(4000),
    BIZ_CODE VARCHAR2(40),
    VERIFI_STRATEGY VARCHAR2(255),
    STATISTICS_TIME TIMESTAMP(6),
    CONTROL_STRATEGY VARCHAR2(255),
    RULE_NAME VARCHAR2(4000),
    TRIGGER_AMOUNT NUMBER(11),
    IS_TODAY NUMBER(*)
);
COMMENT ON COLUMN ONLINE_SHENGPAY_MGR.HIT_STRATEGY_STATISTICS_REPORT.RULE_CODE IS '规则编号';
COMMENT ON COLUMN ONLINE_SHENGPAY_MGR.HIT_STRATEGY_STATISTICS_REPORT.BIZ_CODE IS '业务类型';
COMMENT ON COLUMN ONLINE_SHENGPAY_MGR.HIT_STRATEGY_STATISTICS_REPORT.VERIFI_STRATEGY IS '验证策略';
COMMENT ON COLUMN ONLINE_SHENGPAY_MGR.HIT_STRATEGY_STATISTICS_REPORT.STATISTICS_TIME IS '统计时间';
COMMENT ON COLUMN ONLINE_SHENGPAY_MGR.HIT_STRATEGY_STATISTICS_REPORT.CONTROL_STRATEGY IS '管控策略';
COMMENT ON COLUMN ONLINE_SHENGPAY_MGR.HIT_STRATEGY_STATISTICS_REPORT.RULE_NAME IS '规则名称';
COMMENT ON COLUMN ONLINE_SHENGPAY_MGR.HIT_STRATEGY_STATISTICS_REPORT.TRIGGER_AMOUNT IS '触发量';
